    false,nt"url": null,nt"notes": "Area time counts of the endangered Delmarva
    Peninsula Fox Squirrels and concurrently of Eastern Grey Squirrels were conducted
    in 1977 on several mornings during the period from October 28 to November 21. In
    the past, a single count each year was taken at each of 50 locations distributed
    through timbered tracts on the Blackwater National Wildlife Refuge. This year it
    was decided to get some idea of the variation that would occur between repeated
    counts taken over a short period at a small number of locations. The idea was that
    this method would give some indication of the variation between counts that was
    not dependent on variation in the squirrel populations.",nt"license_title":
